import React from 'react';

const Alert = props => {
  return (
    <div id='modal1' class='modal bottom-sheet'>
      <div class='modal-content'>
        <p>{props.text}</p>
      </div>
      <div class='modal-footer'>
        <div class='modal-close waves-effect waves-green btn-flat'>Agree</div>
      </div>
    </div>
  );
};

export default Alert;
